import React from 'react';
import sample from './../sample.json'

function Twitter() {
  console.log(sample);
  let tweetText = [];
  let tweetList = [];
  // sample.map((tweet) =>
  //   <li>{tweet.text}</li>,
  //   tweetText.push(tweet.text)
  // );

  sample.forEach(tweet => {
    tweetList.push(<li>{tweet.text}</li>);
    // Finds index of https link and cuts it off before creating master tweetText
    tweetText.push(tweet.text);
  });

  console.log(tweetList);

  // tweetText.push(tweet.text.slice(0, tweet.text.indexOf('https://')).trim());

  // makes an array of every word tweeted
  let wordArray = [];
  tweetText.forEach(word => {
    if (!word.startsWith('https')) {
      wordArray.push(word)
    }
  });
  tweetText.join(' ').split(' ');
  console.log(wordArray);



  return (
    <div>
      <h2>Twitter comp here makes API call</h2>
      <ul>
        {tweetList}
      </ul>
    </div>
  );

}

export default Twitter;
